import React, { useState } from "react";
import { StyleSheet, Text, View } from "react-native";
import { primaryColors, fonts } from "./Styles.js";
//import * as Font from "expo-font";
import { useFonts } from "@use-expo/font";
import { AppLoading } from "expo";

import PriceArea from "./components/PriceArea.js";
import DateHeader from "./components/DateHeader.js";
/*
const getFonts = () =>
  Font.loadAsync({
    "nintendoP_Humming-E_002pr": require("./assets/fonts/nintendoP_Humming-E_002pr.otf"),
  });
*/
export default function App() {
  let [fontsLoaded] = useFonts({
    "acnh-main": require("./assets/fonts/nintendoP_Humming-E_002pr.otf"),
  });

  if (fontsLoaded) {
    return (
      <View style={styles.container}>
        <DateHeader />
        <PriceArea />
        <Text style={styles.priceButton}>Font Check</Text>
      </View>
    );
  } else {
    return <AppLoading startAsync={getFonts} onFinish={setFontsLoaded(true)} />;
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: primaryColors.islandgreen,
    alignItems: "center",
  },
  priceButton: {
    fontFamily: "acnh-main",
  },
});
